Описание:
Арт. 60998617 Продается земельный участок в районе 2-й Дачной под размещение многоквартирных домов. 

Расположение:  Саратовская область, г Саратов, Деловой проезд, д. 9
Площадь участка: 1 675 кв. м;
Категория земель: Земли населённых пунктов;
Разрешенное использование: Размещение многоквартирных домов этажностью девять этажей и выше, в т.ч. со встроенными и (или) встроенно-пристроенными нежилыми помещениями, размещение отдельно стоящих и пристроенных гаражей, в том числе подземных, предназначенных для хранения автотранспорта, в том числе с разделением на машино-места, за исключением служебных гаражей;
Участок расположен в территориальной зоне Ж1;
Участок расчищен от застройки.
Рядом расположены:  школы, поликлиники, детские сады, аптеки и магазины, 3 фото
